# echo ${mentor_data}


for IDENTITY in "${!mentor_data[@]}"
do
    mentorText="mentor"
    mentorNumber=$((IDENTITY + 1))
    mentorText+=$mentorNumber

    dfx identity use "${mentorText}"
    CURRENT_PRINCIPAL=$(dfx identity get-principal)
    echo "Using identity $mentorText with principal $CURRENT_PRINCIPAL"

    # Extract and use the mentor data for the current identity
    mentor_DATA=${mentor_data[$IDENTITY]}
    echo "Registering with data: $mentor_DATA"

    # Call the register_mentor function with the current identity and its unique data
    dfx canister call $CANISTER register_mentor_candid "($mentor_DATA)" --network ic

    # approve_vc_creation_request
    echo "approving the request"
    dfx canister call --identity default $CANISTER approve_mentor_creation_request_candid "(principal \"$CURRENT_PRINCIPAL\", true)" --network ic
done


